import React from 'react';
import styled from 'styled-components';

const Poster = styled.div``;

const MoviePoster = () => {
  return (
    <>
      <div className="col-md-3">
        <Poster>
          <img src="/img/poster1.jpg" width="100%" />
        </Poster>
      </div>
    </>
  );
};

export default MoviePoster;
